<template>
  <view>
   

    <view class="header_title">南博预约服务系统</view>
    <ul>
      <li>
        <button v-if="flag==-1" @click="appointment">
          <image  src='/static/images/cgyy_bg.png' mode='widthFix'></image>
          <p>参观预约</p>
        </button>
        <button v-if="flag==0" @click="appointment" open-type="getPhoneNumber" @getphonenumber="getPhoneNumber">
          <image  src='/static/images/cgyy_bg.png' mode='widthFix'></image>
          <p>参观预约</p>
        </button>
        <button v-if="flag==1" @click="appointment" open-type="getUserInfo" @getuserinfo="getUserInfo">
          <image  src='/static/images/cgyy_bg.png' mode='widthFix'></image>
          <p>参观预约</p>
        </button>
        <button v-if="flag==2" @click="appointment">
          <image  src='/static/images/cgyy_bg.png' mode='widthFix'></image>
          <p>参观预约</p>
        </button>
      </li>
      <li>
        <button @click="go('../guide/main')" >
          <image  src='/static/images/hdyy_bg.png' mode='widthFix'></image>
          <p>活动预约</p>
        </button>
      </li>
            <li>
        <button @click="go('../guide/main')" >
          <image  src='/static/images/hdyy_bg.png' mode='widthFix'></image>
          <p>活动预约</p>
        </button>
      </li>
      <li>
        <button v-if="flag==-1" type="primary">
          <image  src='/static/images/grzx_bg.png' mode='widthFix'></image>
          <p>个人中心</p>
        </button>
        <button v-if="flag==0" type="primary" open-type="getPhoneNumber" @getphonenumber="getPhoneNumber">
          <image  src='/static/images/grzx_bg.png' mode='widthFix'></image>
          <p>个人中心</p>
        </button>
        <button v-if="flag==1" type="primary" open-type="getUserInfo" @getuserinfo="getUserInfo">
          <image  src='/static/images/grzx_bg.png' mode='widthFix'></image>
          <p>个人中心</p>
        </button>
        <button v-if="flag==2" type="primary" @click="go('../my/main')">
          <image  src='/static/images/grzx_bg.png' mode='widthFix'></image>
          <p>个人中心</p>
        </button>
      </li>
      
    <p class="footer_text">南山博物馆网上预约系统</p>
    </ul>

    <van-notify id="van-notify" />
    <van-toast id="van-toast" />
  </view>
