<script>
import Toast from '../../../static/vant/toast/toast';
import Notify from '../../../static/vant/notify/notify';
export default {
  data () {
    return {
      flag: -1,//0是完全无授权 1是已授手机 2都已授权
    }
  },
  created () {
    // let app = getApp()
  },
  onShow() {
    /* Toast.loading({
      mask: true,
      message: '加载中...',
    }); */
    wx.login({
      success: (res) => {
        let code = res.code
        wx.request({
          url: this.globalData.url + '/login',
          data: {
            code: code
          },
          success: (res) => {
            let userInfo = JSON.parse(res.data)
            console.log(userInfo)
            this.globalData.user = userInfo
            if(userInfo.mobile.length==0){
              this.flag = 0
              return
            }
            if(userInfo.avatarUrl.length==0){
              this.flag = 1
              return
            }
            this.flag = 2
          }
        })
      }
    })
    /* wx.login({
      success: (res) => {
        let code = res.code
        console.log(res)
      }
    }) */
  },
  onLoad(){
    wx.setNavigationBarTitle({
      title:'南博信息预约',
    })
    wx.setNavigationBarColor({
      frontColor: '#333333',
      backgroundColor: '#000',
      animation: {
        duration: 400,
        timingFunc: 'easeIn'
      }
    })
    /* wx.setNavigationBarColor({
      frontColor:'#ffffff',//前景颜色值，包括按钮、标题、状态栏的颜色，仅支持 #ffffff 和 #000000 (微信小程序官方规定)
      backgroundColor:'1a2241'//背景颜色值，有效值为十六进制颜色
    }) */
  },
  methods: {
    appointment(url){
      if(this.globalData.user.realname){
        wx.redirectTo({url: '../chooseMuseum/main'})
      }else{
        wx.redirectTo({url: '../certification/main'})
      }
    },
    getSession_key(){
      wx.login({
        success: (res) => {
          wx.request({
            url: this.globalData.url + '/login/' + res.code,
            success: (res) => {
              console.log(res)
              return res
            }
          })
        }
      })
    },
    getUserInfo(e){
      console.log(e)
      if (e.mp.detail.errMsg == 'getUserInfo:ok') {
        /* 如果授权成功 */
        this.saveUserInfo(e.mp.detail.userInfo.nickName,e.mp.detail.userInfo.avatarUrl,e.mp.detail.userInfo.gender)
        Toast.success('授权成功');
      }else{
        Toast.fail('请授权用户');
      }
    },
    /* 保存用户授权后的用户信息 */
    saveUserInfo(nickname,avatarUrl,gender){
      wx.login({
        success: (res) => {
          wx.request({
            url: this.globalData.url + '/login',
            data: {
              code: res.code,
              nickname: nickname,
              avatarUrl: avatarUrl,
              gender: gender
            },
            success: (res) => {
              let userInfo = JSON.parse(res.data)
              console.log(userInfo)
              this.globalData.user = userInfo
              this.flag = 2
            }
          })
        }
      })
    },
    getPhoneNumber(e){
      console.log(e)
      if (e.mp.detail.errMsg == 'getPhoneNumber:ok') {
        /* 如果授权成功 */
        this.flag = 1
        this.getPhone(e.mp.detail.encryptedData,e.mp.detail.iv)
        Toast.success('授权成功');
      }else{
        Toast.fail('请授权手机');
      }
    },
    /* 后台解密手机 */
    getPhone(encryptedData,iv){
      wx.login({
        success:(res)=>{
          let code = res.code
          wx.request({
            url: this.globalData.url + '/login/' + code,//获取sessionKey
            success: (res) => {
              console.log(res)
              wx.request({
                url: this.globalData.url + '/phone',
                data: {
                  sessionKey: JSON.parse(res.data).sessionKey,
                  encryptedData: encryptedData,
                  iv: iv
                },
                success: (res) => {
                  if(this.saveUserPhone(JSON.parse(res.data).phoneNumber)){
                    this.flag = 1
                  }
                }
              })
            }
          })
        }
      })
    },
    /* 电话号码存后台 */
    saveUserPhone(mobile) {
      wx.request({
        url: this.globalData.url + '/xguser',
        data: {
          id: this.globalData.user.id,
          mobile: mobile
        },
        success: (res) => {
          console.log(res)
          return true
        }
      })
    },
    go(url){
      wx.redirectTo({url: url})
    }
  }
}
</script>

